func testRelationshipsSliceUpdateAll(t *testing.T) {
	t.Parallel()

	if len(relationshipAllColumns) == len(relationshipPrimaryKeyColumns) {
		t.Skip("Skipping table with only primary key columns")
	}

	seed := randomize.NewSeed()
	var err error
	o := &Relationship{}
	if err = randomize.Struct(seed, o, relationshipDBTypes, true, relationshipColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Relationship struct: %s", err)
	}

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()
	if err = o.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Error(err)
	}

	count, err := Relationships().Count(ctx, tx)
	if err != nil {
		t.Error(err)
	}

	if count != 1 {
		t.Error("want one record, got:", count)
	}

	if err = randomize.Struct(seed, o, relationshipDBTypes, true, relationshipPrimaryKeyColumns...); err != nil {
		t.Errorf("Unable to randomize Relationship struct: %s", err)
	}

	// Remove Primary keys and unique columns from what we plan to update
	var fields []string
	if strmangle.StringSliceMatch(relationshipAllColumns, relationshipPrimaryKeyColumns) {
		fields = relationshipAllColumns
	} else {
		fields = strmangle.SetComplement(
			relationshipAllColumns,
			relationshipPrimaryKeyColumns,
		)
	}

	value := reflect.Indirect(reflect.ValueOf(o))
	typ := reflect.TypeOf(o).Elem()
	n := typ.NumField()

	updateMap := M{}
	for _, col := range fields {
		for i := 0; i < n; i++ {
			f := typ.Field(i)
			if f.Tag.Get("boil") == col {
				updateMap[col] = value.Field(i).Interface()
			}
		}
	}

	slice := RelationshipSlice{o}
	if rowsAff, err := slice.UpdateAll(ctx, tx, updateMap); err != nil {
		t.Error(err)
	} else if rowsAff != 1 {
		t.Error("wanted one record updated but got", rowsAff)
	}
}

